    [],nt"revision_timestamp": "2016-07-27T23:06:20.201527",nt"name": "proposal-addressing-structural-uncertainty-in-a-decision-making-framework-to-inform-scaup-",nt"isopen":
    false,nt"url": null,nt"notes": "We are proposing to examine the role of
    harvest in annual and seasonal survival of lesser scaup, a key structural uncertainty
    in current population models identified in the draft scaup conservation action plan.
    The effect of harvest on the population dynamics of exploited species of game birds
    is poorly understood. We are proposing to use this framework for lesser scaup, building
    upon data from a marked population in southwestern Montana. This work will provide
    the first estimate of the correlation between u2018naturalu2019 and harvest mortality
    in lesser scaup that we are aware of, and will be used to parameterize a scaup survival
    model used in a scaup conservation planning framework.",nt"license_title":
